  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0112251 includes chemical,
  discrete sample, physical and profile data collected from MIRAI in the North Pacific
  Ocean from 1998-10-30 to 1998-12-15 and retrieved during cruise 49NZ19981030 and
  MR98-K01. These data include ALKALINITY, AMMONIUM, DISSOLVED INORGANIC CARBON, DISSOLVED
  OXYGEN, HYDROSTATIC PRESSURE, NITRATE, NITRITE, PHOSPHATE, SALINITY, SILICATE, WATER
  TEMPERATURE and pH. The instruments used to collect these data include CTD, Coulometer
  for DIC measurement and bottle. These data were collected by Akihiko Murata, Yuichiro
  Kumamoto, Makio Honda and Masashi Kusakabe of Japan Agency for Marine-Earth Science
  and Technology (Jamstec) as part of the PACIFICA_49NZ19981030 data set.nnPACIFICA
  (PACIFic ocean Interior CArbon) was an international collaborative project for the
  data synthesis of ocean interior carbon and its related parameters in the Pacific
  Ocean. The North Pacific Marine Science Organization (PICES), Section of Carbon
  and Climate (S-CC) supported the project.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
